import { Collection } from "../../util/collection.js";
/** Gets the webhooks for this channel. Requires MANAGE_WEBHOOKS */
export async function getChannelWebhooks(bot, channelId) {
    const results = await bot.rest.runMethod(bot.rest, "GET", bot.constants.routes.CHANNEL_WEBHOOKS(channelId));
    return new Collection(results.map((result) => {
        const webhook = bot.transformers.webhook(bot, result);
        return [webhook.id, webhook];
    }));
}
